import React, { useState } from "react";
import styles from "./Navbar.module.css";

//

export default function Navbar({ setPage }) {
  const [isActive, setIsActive] = useState(false);

  const onClick_MenuBtn_Handler = () => setIsActive(!isActive);
  const onClick_Landing_Handler = () => setPage("Landing");
  const onClick_UberUns_Handler = (event) => console.log(event.target); //setPage("UeberUns");
  const onClick_Aktuelles_Handler = () => setPage("Aktuelles");
  const onClick_Sportliches_Handler = () => setPage("Sportliches");
  const onClick_Impressum_Handler = () => setPage("Impressum");

  return (
    <nav className={`${styles.nav} ${isActive ? styles.nav__open : ""}`}>
      <button className={styles.nav__menuBtn} onClick={onClick_MenuBtn_Handler}>
        <i className="fa-regular fa-circle-right"></i>
      </button>
      <button className={styles.nav__logo} onClick={onClick_Landing_Handler}>
        SG Eintracht Halfing E.V.
      </button>
      <ul className={styles.nav__ul}>
        <li>
          <button onClick={onClick_UberUns_Handler} page="UeberUns">
            Ãœber Uns
          </button>
        </li>
        <li>
          <button onClick={onClick_Aktuelles_Handler}>Aktuelles</button>
        </li>
        <li>
          <button onClick={onClick_Sportliches_Handler}>Sportliches</button>
        </li>
        <li>
          <button onClick={onClick_Impressum_Handler}>Impressum</button>
        </li>
      </ul>
    </nav>
  );
}
